import React, { Component } from 'react'
import { createCipher } from 'crypto'
import { IScheduleElement } from '../Interfaceses/IScheduleElement'
import { Image } from 'react-bootstrap'
import styles from './../styles/scheduleElement.module.css'
export interface ScheduleElementProps {
  scheduleElement: IScheduleElement
}

export interface ScheduleElementState {}

class Series extends React.Component<
  ScheduleElementProps,
  ScheduleElementState
> {
  constructor(props: ScheduleElementProps) {
    super(props)
  }
  render() {
    const element = { ...this.props.scheduleElement }
    return (
      <div className={styles.main}>
        <Image src={require('./../' + element.posterUrl)} rounded />
        {/* <Image
          style={styles.img}
          src={require('./../' + element.posterUrl)}
          mode="fit"
          width={50}
          height={50}
        /> */}

        <div className={styles.numTime}>
          <span>{element.seriesNum}</span>
          <span>{element.name}</span>
        </div>
      </div>
    )
  }
}

export default Series
